export const getAccountBalance = (
  id: string,
  options?: SecondParameter<typeof ebInstance>,
  signal?: AbortSignal
) => {
  return ebInstance<AccountBalanceResponse>(
    { url: `/ef/v1/accounts/${id}/balances`, method: 'GET', signal },
    options
  );
};

export const getGetAccountBalanceQueryKey = (id: string) => {
  return [`/ef/v1/accounts/${id}/balances`] as const;
};

export const getGetAccountBalanceQueryOptions = <
  TData = Awaited<ReturnType<typeof getAccountBalance>>,
  TError = ErrorType<
    | N400Response
    | N401Response
    | N403Response
    | N404Response
    | N500Response
    | N503Response
  >,
>(
  id: string,
  options?: {
    query?: Partial<
      UseQueryOptions<
        Awaited<ReturnType<typeof getAccountBalance>>,
        TError,
        TData
      >
    >;
    request?: SecondParameter<typeof ebInstance>;
  }
) => {
  const { query: queryOptions, request: requestOptions } = options ?? {};

  const queryKey = queryOptions?.queryKey ?? getGetAccountBalanceQueryKey(id);

  const queryFn: QueryFunction<
    Awaited<ReturnType<typeof getAccountBalance>>
  > = ({ signal }) => getAccountBalance(id, requestOptions, signal);

  return {
    queryKey,
    queryFn,
    enabled: !!id,
    ...queryOptions,
  } as UseQueryOptions<
    Awaited<ReturnType<typeof getAccountBalance>>,
    TError,
    TData
  > & { queryKey: QueryKey };
};

export type GetAccountBalanceQueryResult = NonNullable<
  Awaited<ReturnType<typeof getAccountBalance>>
>;
export type GetAccountBalanceQueryError = ErrorType<
  | N400Response
  | N401Response
  | N403Response
  | N404Response
  | N500Response
  | N503Response
>;

/**
 * @summary Get an account balance
 */
export const useGetAccountBalance = <
  TData = Awaited<ReturnType<typeof getAccountBalance>>,
  TError = ErrorType<
    | N400Response
    | N401Response
    | N403Response
    | N404Response
    | N500Response
    | N503Response
  >,
>(
  id: string,
  options?: {
    query?: Partial<
      UseQueryOptions<
        Awaited<ReturnType<typeof getAccountBalance>>,
        TError,
        TData
      >
    >;
    request?: SecondParameter<typeof ebInstance>;
  }
): UseQueryResult<TData, TError> & { queryKey: QueryKey } => {
  const queryOptions = getGetAccountBalanceQueryOptions(id, options);

  const query = useQuery(queryOptions) as UseQueryResult<TData, TError> & {
    queryKey: QueryKey;
  };

  query.queryKey = queryOptions.queryKey;

  return query;
};
